import React from 'react';
import { VictoryPie } from 'victory';

const PieChart = () => {
    return ( <
        VictoryPie style = {
            { labels: { fill: "white" } }
        }
        innerRadius = { 100 }
        data = {
            [
                { x: 1, y: 80 },
                { x: 2, y: 20 }
            ]
        }
        />
    );

}
export default PieChart;
